import { Navigate } from "react-router-dom";
 
export default function PrivateRoute({ children }) { //privatw route-> parent ex->dashboard->children
  const token = localStorage.getItem("token");
 
  // If no token redirect to login
  if (!token) {
    return <Navigate to="/Userlogin" replace />;
  }
  return children;
}
 
//is used to protect the routes that should only be accessible to authenticated users
